import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

const SingleMain = () => {
  const { id } = useParams();
  useEffect(() => {
    fetch(`/Boutique/"${id}`)
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);
  return <div>""</div>;
};

export default SingleMain;
